    const addToFav = useSelector((state) => state.likedMovie);

    console.log(addToFav)

    return (
        <Grid container>
            <Grid item xs={12} sm={12}>
                {!isMobile && <NavBar />}
            </Grid>
            <Grid item xs={12} sm={6} container direction="row" justify="center" alignItems="center">
                {addToFav?.map((fav) => {
                    return (
                        <FavoriesCard/>
                    )
                })}
            </Grid>
        </Grid>
    )
}

